function DashCancel(props)
{
    return(
    <div class="col-md-6 col-sm-6 col-lg-6 col-xl-3">
        <div class="dash-widget">
           <span class="dash-widget-bg3"><i class="fa fa-stethoscope" aria-hidden="true"></i></span>
              <div class="dash-widget-info text-right">
            <h3>{props.dashCancel}</h3>
            <span class="widget-title3">Canceled <i class="fa fa-check" aria-hidden="true"></i></span>
          </div>
        </div>
    </div>
    );
}

export default DashCancel;
